import styles from "../styles/Projects.module.css";
import { Box } from "@mui/material";
import Grid from "@mui/material/Grid";

const Projects = () => {
  return (
    <div className={styles.all}>
      <h1 style={{ marginBottom: "2%" }}>Projects</h1>
      <div className={styles.column_left}>
        <Box className={styles.experience_box}>project 1 in here</Box>
      </div>
      <div className={styles.column_right}>
        <Box className={styles.experience_box}>project 2 in here</Box>
      </div>

      <div className={styles.column_left}>
        <Box className={styles.experience_box}>project 3 in here</Box>
      </div>
      <div className={styles.column_right}>
        <Box className={styles.experience_box}>project 4 in here</Box>
      </div>
    </div>
  );
};

export { Projects };
